import React from 'react';
import { View, Text } from 'react-native';

const App = () => {
  return (
    <View
      style={{
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
      }}
    >
      <View>
        <Text>Caixa 1</Text>
      </View>

      <View>
        <Text>Caixa 2</Text>
      </View>
    </View>
  );
};

export default App;
